$(document).ready(function(){var d=$("#docstrap-document");var b=$("#docstrap-content-list");var a=[];scrollTo=function(e){$("html, body").animate({scrollTop:$(e).offset().top-($("#docstrap-header").height()+10)},500);location.hash=e};d.find("h1").wrap('<div class="page-header"/>');d.find("table").addClass("table table-bordered table-striped");var c=d.find("h2, h3, h4, h5, h6");if(c.length==0){b.parent("li").remove()}else{c.each(function(f){var h=$(this).text().toLowerCase();h=h.replace(new RegExp("[àáâãäå]","g"),"a");h=h.replace(new RegExp("æ","g"),"ae");h=h.replace(new RegExp("ç","g"),"c");h=h.replace(new RegExp("[èéêë]","g"),"e");h=h.replace(new RegExp("[ìíîï]","g"),"i");h=h.replace(new RegExp("ñ","g"),"n");h=h.replace(new RegExp("[òóôõö]","g"),"o");h=h.replace(new RegExp("œ","g"),"oe");h=h.replace(new RegExp("[ùúûü]","g"),"u");h=h.replace(new RegExp("[ýÿ]","g"),"y");h=h.replace(/[^a-z0-9]/gi,"-");if(a.indexOf(h)!=-1){h+="-"+f}a.push(h);$(this).attr("id",h).prepend('<a href="#'+h+'"><i class="icon-share"></i></a>');var g=$(this).prop("nodeName").replace("H","");var e=g>2?'<li class="sub">':"<li>";e+='<a href="#'+h+'">';e+=$(this).text();e+="</a></li>";b.append(e)})}b.find("a").on("click",function(e){e.preventDefault();scrollTo($(this).attr("href"))});d.find("h2 a, h3 a, h4 a, h5 a, h6 a").on("click",function(e){e.preventDefault();scrollTo($(this).attr("href"))});if(location.hash){scrollTo(location.hash)}$("#docstrap-gototop").on("click",function(e){e.preventDefault();scrollTo("#docstrap-document")});d.find(".sidebar").appear().on("appear",function(){$("#docstrap-gototop").fadeOut()}).on("disappear",function(){$("#docstrap-gototop").fadeIn()});$("li.dropdown").hover(function(){$(this).addClass("open")},function(){$(this).removeClass("open")});$("#docstrap-document pre").addClass("prettyprint linenums");window.prettyPrint&&prettyPrint()});